function setRowData(idsite,visits,actions,revenue,name,url,visitsSummaryValue,actionsSummaryValue,revenueSummaryValue)
{this.idsite=idsite;this.visits=visits;this.revenue=revenue;this.name=name;this.url=url;this.actions=actions;this.visitsSummaryValue=parseFloat(visitsSummaryValue);this.actionsSummaryValue=parseFloat(actionsSummaryValue);this.revenueSummaryValue=parseFloat(revenueSummaryValue);}
function setOrderBy(self,allSites,params,mOrderBy)
{if(params['mOrderBy']==mOrderBy){if(params['order']=='desc'){params['order']='asc';}else{params['order']='desc';}}
params['mOrderBy']=mOrderBy;prepareRows(allSites,params);$('.arrow').removeClass('multisites_desc multisites_asc');if($(self).attr('class')=='evolution')
{mOrderBy='evolution';}
$('#'+mOrderBy+'  .arrow').addClass('multisites_'+params['order']);return params;}
function prepareRows(allUnsortedSites,params)
{var allSites;$("#tb").find("tr").remove();$("#next").html('');$("#prev").html('');var mOrderBy=params['mOrderBy'];allSites=orderBy(allUnsortedSites,params);if(allSites.length>params['limit'])
{allSites=limitBy(allSites,params);}
displayRows(allSites,params);showPagination(allUnsortedSites,params);params['sitesVisible']=allSites;}
function orderBy(allSites,params)
{if(params['mOrderBy']=='names')
{allSites.sort(function(a,b){if(a['name'].toLowerCase()==b['name'].toLowerCase())
{return 0;}
return(a['name'].toLowerCase()<b['name'].toLowerCase())?-1:1;});}
else if(params['mOrderBy']=='visits')
{allSites.sort(function(a,b){if(a['visits']==b['visits']){return 0;}
return(a['visits']<b['visits'])?-1:1;});}
else if(params['mOrderBy']=='actions')
{allSites.sort(function(a,b){if(a['actions']==b['actions']){return 0;}
return(a['actions']<b['actions'])?-1:1;});}
else if(params['mOrderBy']=='revenue')
{allSites.sort(function(a,b){if(a['revenue'].replace(/[^0-9\.]+/g,"")==b['revenue'].replace(/[^0-9\.]+/g,"")){return 0;}
return(parseFloat(a['revenue'].replace(/[^0-9\.]+/g,""))<parseFloat(b['revenue'].replace(/[^0-9\.]+/g,"")))?-1:1;});}
else if(params['mOrderBy']=='revenueSummary')
{allSites.sort(function(a,b){if(a['revenueSummaryValue']==b['revenueSummaryValue']){return 0;}
return(a['revenueSummaryValue']-b['revenueSummaryValue']<=0.01)?-1:1;});}
else if(params['mOrderBy']=='actionsSummary')
{allSites.sort(function(a,b){if(a['actionsSummaryValue']==b['actionsSummaryValue']){return 0;}
return(a['actionsSummaryValue']-b['actionsSummaryValue']<=0.01)?-1:1;});}
else if(params['mOrderBy']=='visitsSummary')
{allSites.sort(function(a,b){if(a['visitsSummaryValue']==b['visitsSummaryValue']){return 0;}
return(a['visitsSummaryValue']-b['visitsSummaryValue']<=0.01)?-1:1;});}
if(params['order']=='desc')
{allSites.reverse();}
return allSites;}
function limitBy(allSites,params)
{var begin=(params['page']-1)*params['limit'];var end=(params['page']*params['limit']);return allSites.slice(begin,end);}
function switchEvolution(params)
{$('.actions').hide();$('.revenue').hide();$('.visits').hide();$('.'+params['evolutionBy']).show();sitesVisible=params['sitesVisible'];for(i=0;i<allSites.length;i++)
{$('#sparkline_'+allSites[i].idsite).html(getSparklineImg(allSites[i].idsite,params['evolutionBy'],params));}}
function displayRows(allSites,params)
{for(var i=0;i<allSites.length;i++)
{var str=params['row'];str=str.replace(/%revenueSummary%/g,getImageForSummary(allSites[i].revenueSummaryValue));str=str.replace(/%actionsSummary%/g,getImageForSummary(allSites[i].actionsSummaryValue));str=str.replace(/%visitsSummary%/g,getImageForSummary(allSites[i].visitsSummaryValue));str=str.replace(/%sparkline%/g,getSparklineImg(allSites[i].idsite,params['evolutionBy'],params));str=str.replace(/%actions%/g,allSites[i].actions);str=str.replace(/%idsite%/g,allSites[i].idsite);str=str.replace(/%visits%/g,allSites[i].visits);str=str.replace(/%name%/g,allSites[i].name);str=str.replace(/%revenue%/g,allSites[i].revenue);str=str.replace(/%main_url%/g,allSites[i].url);str=str.replace(/%date%/g,params['date']);str=str.replace(/%period%/g,params['period']);$('#tb').append('<tr class="tables_row" id="row_'+allSites[i].idsite+'">'+str+'</tr>');}
$(".table_row").show();$('.actions').hide();$('.revenue').hide();$('.visits').hide();$('#main_indicator').hide();$('.'+params['evolutionBy']).show();$("#main_indicator").hide();}
function getSparklineImg(id,column,params)
